import React from "react";
import { Header, Container } from 'semantic-ui-react';

function Uhmath() {
  return (
      <Container>
        <br/>
        <Header as ="h2" textAlign="center">Uhmath ME</Header>
        <Container text>
          <hr/>
          <p></p>
        </Container>
      </Container>
  );
}

export default Uhmath;
